function MainComponent() {
    return (
        <>
        <div>
        {walmartData.map((data) => {
                return (
                    <div>
                        console.log({data})
                    </div>

                )
            })}
            <h1>Nagłówek h1</h1>
        </div>
        <div>
            <div>
                <FirstBlockComponent/>
            </div>
            <div>
                <SecondBlockComponent/>
            </div>
            <div>
                <ThirdBlockComponent/>
            </div>



        </div>
        </>
    )
}

export default MainComponent
